import React from "react";
import ReactDOMClient from "react-dom/client";
import "./css/main.css";

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: "",
    };
    this.ProgramTime = this.ProgramTime.bind(this);
  }
  render() {
    return (
      <div>
        <h3>{this.ProgramTime}</h3>
      </div>
    );
  }
  ProgramTime = () => {
    setInterval = () => {
      this.setState({ time: Date() }), 1000;
      return console.log(this.time);
    };
  };
}
export default Clock;
const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Clock />);
